import React from 'react'

import Person from './Person/person'

const persons = (arg) => {

    return (arg.people.map((argument,index) => {
        return <Person name ={argument.p_name}
                      age ={argument.p_age}
                      click={()=>arg.clicked(index)}
                      Id={argument.id}/>
      })

);
}

export default persons;
